import { Component } from '@angular/core';
import { HomeService } from '../services/home.service';

@Component({
    selector: 'home',
    styles: [``],
    template: `
        <google-map height="400px" width="750px" [center]="center" [zoom]="zoom" (mapClick)="moveMap($event)" (mapMousemove)="move($event)"></google-map>
        <div>Latitude: {{display?.lat}}</div>
        <div>Longitude: {{display?.lng}}</div>
    `
})
export class HomeComponent 
{
    data: any;
    display: any;
    center: google.maps.LatLngLiteral = {
        lat: 24,
        lng: 12
    };
    zoom = 4;
    constructor(public home: HomeService)
    {

    }

    moveMap(event: google.maps.MapMouseEvent)
    {
        if (event.latLng != null)
            this.center = (event.latLng.toJSON());
    }

    move(event: google.maps.MapMouseEvent)
    {
        if (event.latLng != null)
            this.display = event.latLng.toJSON();
    }

    ngOnInit()
    {
        this.getData();
        this.postData();
    }
    getData(): void 
    {
        this.home.getData().subscribe((result) => {
            this.data = result;
            console.log(this.data);
        });
      }    
    // Example POST operation
    postData(): void 
    {
        const newData = {Name: 'Davor'};
        this.home.postData(newData).subscribe(() => {
                console.log('Data inserted successfully');
                // Optionally, fetch updated data after insertion
                this.getData();
            },
            (error) => {
                console.error('Error inserting data:', error);
            }
        );
    }      
}
